window.bookSummaryJSON = "<p>Cora's a young girl with two dreams: to be a dragon jockey when she grows up and to own a pet dragon now. She constantly buys \"egg packs\" at the dragon emporium in hopes that one will hatch into a rare pet-sized dragon, but only gets short-lived mayflies. However, when an unexpected egg does develop into something new, Cora may be over her head. </p>"; 
